$(".searchCompass").on("click", function searchCity() {
	var city = $(".search").val();
	$(".modal").modal("hide");
	$("#weatherNow").html("<img></img><p id='description'></p><p id='nowTime'></p>");
	$.getJSON("https://cors-anywhere.herokuapp.com/http://api.openweathermap.org/data/2.5/weather?q=" + city + "&APPID=e00e2c00f684de6546a4a9dc3efcf530&" + new Date().getTime(), function(cdata) {
		cityLat = cdata.coord.lat;
		cityLon = cdata.coord.lon;
		loadWeatherInfo(cityLat, cityLon); //load weather info with ooords of the city
	});
});
	
